import React, { Component } from 'react';


class FoodList extends Component {
  render() {
    const buildMenu = this.props.menu.map((item, index) => (
      <div key={index} className="card col-3">
          <img className='card-img=top' src={item.image} alt={item.menu_item}/>
        {item.menu_item};
        {item.price};

      </div>
    ))

    return(
      <div className="card-container">
        {buildMenu}
      </div>
    )
  }
}

export default FoodList;
